                "imagesjson": "[\n  {\n    \"imgId\": \"\",\n    \"imgNumber\": \"IMG9809\",\n    \"imgAssetDefinitionNumber\": \"\",\n    \"imgTitle\": \"ELISA - Anti-TNF alpha Affibody\® Molecule (AB31908)\",\n    \"resourceType\": \"Image\",\n    \"imgLegend\": \"Standard TNF alpha was titrated on Anti-TNF alpha Affibody\® molecule coated plates with a sensitivity of 60 pg/ml. <p>QUANTITATIVE ELISA </p><p>The Anti-TNF alpha Affibody\® molecule can be used as capture reagent in a sandwich ELISA in combination with a mouse anti-human TNF-alpha monoclonal antibody as the detection reagent. Titration of TNF-alpha gives a sigmoid curve with a sensitivity of 60 pg TNFalpha/ ml (defined as two times background value) and a measurement interval between 100 and 1000 pg/ml.</p>\",\n    \"imgUrl\": \"products/images/application/elisa/9/IMG9809.jpg\",\n    \"imgSeoUrl\": \"products/images/tnf-alpha-affibody-molecule-ab31908--elisa-img9809.jpg\",\n    \"imgApplication\": \"ELISA\",\n    \"imgSpecies\": \"\",\n    \"imgImageUsageJSON\": \"\",\n    \"imgEcl\": \"\",\n    \"imgCondition\": \"\",\n    \"imgExposureTime\": \"\",\n    \"imgCopyrightCredit\": \"\",\n    \"imgSourceExternalId\": \"\",\n    \"imgSourceName\": \"Unknown\"\n  }\n]",
                "skuid": "ab31908-abcam",
                "adstandardproteinposttranslationalmodification": "The soluble form derives from the membrane form by proteolytic processing. The membrane-bound form is further proteolytically processed by SPPL2A or SPPL2B through regulated intramembrane proteolysis producing TNF intracellular domains (ICD1 and ICD2) released in the cytosol and TNF C-domain 1 and C-domain 2 secreted into the extracellular space.",
                "adapplicationreactivityjson": "[\n  {\n    \"fullName\": \"Dot Blot\",\n    \"name\": \"Dot\",\n    \"validationTested\": false,\n    \"validation\": null,\n    \"species\": [\n      {\n        \"name\": \"\",\n        \"speciesIndependent\": false,\n        \"suitability\": \"TESTED_AND_REACTS\",\n        \"recommendedDilution\": \"\",\n        \"notes\": \"<p></p>\",\n        \"speciesDetail\": {\n          \"scientificName\": \"\"\n        }\n      }\n    ]\n  },\n  {\n    \"fullName\": \"ELISA\",\n    \"name\": \"ELISA\",\n    \"validationTested\": false,\n    \"validation\": null,\n    \"species\": [\n      {\n        \"name\": \"\",\n        \"speciesIndependent\": false,\n        \"suitability\": \"TESTED_AND_REACTS\",\n        \"recommendedDilution\": \"\",\n        \"notes\": \"<p>Remove excess DTT by passage through a desalting column, not by dialysis.</p><p>THIS AFFIBODY<sup>®</sup> MOLECULE REQUIRES CONJUGATION TO A SUITABLE LABEL BEFORE USE. PLEASE REFER TO THE \\\"PROTOCOLS\\\" SECTION.</p>\",\n        \"speciesDetail\": {\n          \"scientificName\": \"\"\n        }\n      }\n    ]\n  }\n]",
